(7, 'Contact Information', 'block-contact-us', '<div class="block-contact-us">\r\n<div class="block-title"><span>Contact Information</span></div>\r\n<div class="block-content clearfix">\r\n<ul>\r\n<li><span class="mobi-contact">+ 084 - 04 - 1234567</span></li>\r\n<li><span class="address-contact">Santiego Interpro Road - owando Madison District - East Englewood City</span></li>\r\n<li class="last"><a class="linkcontact" href="mailto:contact@ytcvn.com">contact@ytcvn.com</a></li>\r\n</ul>\r\n</div>\r\n</div>', '2012-08-09 22:59:50', '2012-12-23 20:21:47', 1),
(11, 'Why Choose Us', 'block-user2', '<div class="block-title"><span>Why Choose Us</span></div>\r\n<div class="block-content">\r\n<ul>\r\n<li><a href="#">Shipping &amp; Returns</a></li>\r\n<li><a href="#">Secure Shopping</a></li>\r\n<li><a href="#">International Shipping</a></li>\r\n<li><a href="#">Affiliates</a></li>\r\n<li><a href="#">Group Sales</a></li>\r\n</ul>\r\n</div>', '2012-09-24 10:50:34', '2012-12-23 19:53:30', 1),
(12, 'Opening Hours', 'block-user1', '<div class="block-title"><span>Opening Hours</span></div>\r\n<div class="block-content"><span class="block-desc">Halvah apple pie cake lollipop lollipop cookie. Carrot cake bonbon.</span>\r\n<ul>\r\n<li><a href="#">MON to TUE - 10 AM to 10 PM</a></li>\r\n<li><a href="#">SAT - 12 AM to 12 PM</a></li>\r\n<li><a href="#">SUN - 12 AM to 12 PM</a></li>\r\n</ul>\r\n</div>', '2012-09-24 10:52:18', '2013-01-13 20:43:53', 1),
(14, 'Social with Us', 'block-user4', '<div class="block-title"><span>Social with Us</span></div>\r\n<div class="block-content">\r\n<ul>\r\n<li><a class="logo-facebook logo-item" href="http://www.facebook.com/MagenTech"><span class="harrow"><span class="farrow">facebook</span></span></a></li>\r\n<li><a class="logo-flick logo-item" href="http://www.flickr.com"><span class="harrow"><span class="farrow">flick</span></span></a></li>\r\n<li><a class="logo-twitter logo-item" href="http://twitter.com/smartaddons"><span class="harrow"><span class="farrow">twitter</span></span></a></li>\r\n<li><a class="logo-vimeo logo-item" href="http://vimeo.com/"><span class="harrow"><span class="farrow">vimeo</span></span></a></li>\r\n<li><a class="logo-linkin logo-item" href="http://linkin.com/"><span class="harrow"><span class="farrow">linkin</span></span></a></li>\r\n<li><a class="logo-rss logo-item" href="#"><span class="harrow"><span class="farrow">rss</span></span></a></li>\r\n<!--<li><a class="logo-googleplus logo-item" href="#"><span class="harrow"><span class="farrow">google+</span></span></a></li>\r\n<li><a class="logo-youtube logo-item" href="#"><span class="harrow"><span class="farrow">youtube</span></span></a></li>\r\n<li><a class="logo-email logo-item" href="mailto:admin@magentech.com"><span class="harrow"><span class="farrow">email</span></span></a></li>--></ul>\r\n<div class="logo-payment">Payment methods</div>\r\n</div>', '2012-09-24 10:58:14', '2012-12-23 22:05:13', 1),
(15, 'Newsletter', 'block-user5', '<div class="block-title"><span>Newsletter</span></div>\r\n<div class="block-content"><form id="newsletter-validate-detail" action="newsletter/subscriber/new/" method="post"><label>Sign up for our newsletter</label>\r\n<div class="input-box"><input id="newsletter" class="input-text required-entry validate-email" title="Sign up for our newsletter" onfocus="if(this.value==''Enter your email address'') this.value='''';" onblur="if(this.value=='''') this.value=''Enter your email address'';" type="text" name="email" value="Enter your email address" />\r\n<div class="actions"><button class="button" title="Subscribe" type="submit"><span><span>Subscribe</span></span></button></div>\r\n</div>\r\n</form></div>', '2012-09-24 11:05:45', '2012-11-05 00:51:09', 1),
(16, 'info footer', 'block-info-footer', '<ul>\r\n<li class="nav-item"><a href="{{config path="web/unsecure/base_url"}}about-magento-demo-store">About Us</a></li>\r\n<li class="nav-item"><a href="{{config path="web/unsecure/base_url"}}customer-service ">Customer Service</a></li>\r\n<li class="nav-item"><a href="{{config path="web/unsecure/base_url"}}privacy-policy-cookie-restriction-mode">Privacy Policy </a></li>\r\n<li class="nav-item"><a href="{{config path="web/unsecure/base_url"}}catalog/seo_sitemap/category">Site Map</a></li>\r\n<li class="nav-item"><a href="{{config path="web/unsecure/base_url"}}catalogsearch/term/popular">Search Terms</a></li>\r\n<li class="nav-item"><a href="{{config path="web/unsecure/base_url"}}catalogsearch/advanced/">Advanced Search</a></li>\r\n<li class="nav-item"><a href="{{config path="web/unsecure/base_url"}}customer/account/login/">Orders and Returns</a></li>\r\n<li class="nav-item last"><a href="{{config path="web/unsecure/base_url"}}contacts">Contact Us</a></li>\r\n</ul>', '2012-09-24 14:43:12', '2012-12-10 00:49:23', 1),
