(30, 'Map Contact Form', 'position-2', '<div class="block-map">\r\n<div class="block-content">\r\n<script type="text/javascript" src="http://maps.google.com/maps/api/js?sensor=false"></script>\r\n<div id="map">&nbsp;</div>\r\n<script type="text/javascript">// <![CDATA[\r\n \r\n      var myOptions = {\r\n         zoom: 15,\r\n         center: new google.maps.LatLng(48.89364,2.33739), 	\r\n         mapTypeId: google.maps.MapTypeId.ROADMAP\r\n      };\r\n\r\n      var map = new google.maps.Map(document.getElementById("map"), myOptions);\r\n// ]]></script>\r\n</div>\r\n</div>', '2012-11-29 01:13:27', '2013-01-20 21:23:53', 1),
(31, 'Description Contact Form', 'position-1', '<div class="block-position-1">\r\n<div class="block-content">\r\nForem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque convallis ligula eget tellus lacinia tristique. Vivamus convallis tristique fringilla. Pellentesque pharetra, lacus tincidunt pulvinar facilisis. Fellus risus varius augue, sit amet dictum turpis justo eget felis. Curabitur convallis cursus velit, vel convallis sem aliquam a. Sed non dui consectetur enim mattis suscipit sit amet ac nunc.<br /><br />Fellus risus varius augue, sit amet dictum turpis justo eget felis. Curabitur convallis cursus velit, vel convallis sem aliquam a. Sed non dui consectetur enim mattis suscipit sit amet ac nunc. Donec vestibulum, dui a tristique suscipit, erat mi tristique mi, sit amet posuere nunc sapien tincidunt urna. Quisque id turpis tincidunt orci euismod fermentum ac eget purus. Duis eget dictum velit. Suspendisse turpis mauris, molestie ut pharetra sed, tempor vitae mauris. Ut eget facilisis nulla. Nunc non libero ligula. Forem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque convallis.\r\n</div>\r\n</div>', '2013-01-05 02:17:00', '2013-01-05 02:20:21', 1),
(32, 'Contact 1 Infomation', 'block-contact1', '<div class="block-contact1">\r\n<div class="block-content clearfix">\r\n<ul>\r\n<li>\r\n<div class="address-contact"><span class="subtitle">Address1: </span>Santiego Interpro Road - owando Madison District - East Englewood City</div>\r\n</li>\r\n<li>\r\n<div class="mobi-contact"><span class="subtitle">Tel: </span>084 - 04 - 1234567</div>\r\n</li>\r\n<li class="last">\r\n<div class="mobi-contact"><span class="subtitle">Email: </span><a class="linkcontact" href="mailto:contact1@ytcvn.com">contact1@ytcvn.com</a></div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>', '2013-01-05 08:29:25', '2013-01-06 10:45:32', 1),
(33, 'Contact 2 Infomation', 'block-contact2', '<div class="block-contact2">\r\n<div class="block-content clearfix">\r\n<ul>\r\n<li>\r\n<div class="address-contact"><span class="subtitle">Address2: </span>Goceca Loate Road - Sirican Abandot District - East Englewood City</div>\r\n</li>\r\n<li>\r\n<div class="mobi-contact"><span class="subtitle">Tel: </span> 084 - 05 - 1234567</div>\r\n</li>\r\n<li class="last">\r\n<div class="mobi-contact"><span class="subtitle">Email: </span><a class="linkcontact" href="mailto:contact2@ytcvn.com">contact2@ytcvn.com</a></div>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>', '2013-01-05 08:32:13', '2013-01-06 10:45:09', 1),
(34, 'Notice bar', 'block-notice', '<div class="block-notice">\r\n<div class="block-content"><span class="notice-desc">Happy New Year!!! Discounts up to 20%</span> <a class="notice-btn" href="#">See More</a></div>\r\n</div>', '2013-01-08 20:36:29', '2013-01-18 00:18:35', 1),
(35, 'Custom Box', 'block-custom', '<div class="block-custom">\r\n<div class="block-title"><span>Custom box</span></div>\r\n<div class="block-content">\r\n<div class="custom-desc"><span>This is a CMS box edited from admin panel. You can display a box in the left or right side.</span></div>\r\n<div class="custom-img" style="width: 216px; height: 150px; background: #CCC;"><img src="{{media url="wysiwyg/img-custom.png"}}" alt="" /></div>\r\n<div class="custom-desc"><span>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed velit urna, elementum at dignissim varius, euismod a elit. Praesent ornare metus eget metus commodo rhoncus.</span></div>\r\n<div class="custom-option"><a href="#" class="readmore"><span>Read details +</span></a></div>\r\n</div>\r\n</div>', '2013-01-08 20:48:01', '2013-01-10 02:11:53', 1),
(36, 'Facebook LikeBox', 'block-likebox', '<div class="block-custom block-likebox">\r\n<div class="block-content"><iframe style="border: none; overflow: hidden; width: 237px; height: 258px;" src="//www.facebook.com/plugins/likebox.php?href=http%3A%2F%2Fwww.facebook.com%2Fmagentech&amp;width=235&amp;height=258&amp;show_faces=true&amp;colorscheme=light&amp;stream=false&amp;border_color&amp;header=false" frameborder="0" scrolling="no" width="320" height="240"></iframe></div>\r\n</div>', '2013-01-09 20:55:44', '2013-01-10 02:54:26', 1),
(37, 'Free Shipping', 'block-freeshipping', '<div class="block-title"><span class="sub-title">Free Shipping</span><span>on orders over $99. This offer is valid on all our store items</span></div>\r\n<div class="block-content">\r\n<div class="block-regular">\r\n<div class="row-fluid">\r\n<div class="banner span3"><a href="#"> <img src="{{media url="wysiwyg/banner1.png"}}" alt="" /><span class="hover_shine"></span> </a></div>\r\n<div class="banner span5"><a href="#"> <img src="{{media url="wysiwyg/banner2.png"}}" alt="" /><span class="hover_shine"></span> </a></div>\r\n<div class="banner span4"><a href="#"> <img src="{{media url="wysiwyg/banner3.png"}}" alt="" /><span class="hover_shine"></span> </a></div>\r\n</div>\r\n</div>\r\n<div class="block-pure-slide">\r\n<div id="a1">\r\n<div id="a2">\r\n<div id="a3"><!-- Top Navigation. Ya, tables are evil. --> <!-- Fallback -->\r\n<div id="i0" class="page">\r\n<h1>Your browser sucks.</h1>\r\n</div>\r\n<!-- First Page #a1 -->\r\n<div id="i1" class="page"><a href="#"> <img src="{{media url="wysiwyg/banner1.png"}}" alt="" /> </a></div>\r\n<!-- Second Page #a2 -->\r\n<div id="i2" class="page"><a href="#"> <img src="{{media url="wysiwyg/banner2.png"}}" alt="" /> </a></div>\r\n<!-- Third Page #a3 -->\r\n<div id="i3" class="page"><a href="#"> <img src="{{media url="wysiwyg/banner3.png"}}" alt="" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="block-regular">\r\n<div class="row-fluid">\r\n<div class="banner span4"><a href="#"> <img src="{{media url="wysiwyg/banner4.png"}}" alt="" /><span class="hover_shine"></span> </a></div>\r\n<div class="banner span8"><a href="#"> <img src="{{media url="wysiwyg/banner5.png"}}" alt="" /><span class="hover_shine"></span> </a></div>\r\n</div>\r\n</div>\r\n</div>', '2013-01-15 23:55:11', '2013-01-21 04:15:31', 1),
(38, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-01-23 03:25:44', '2014-01-23 03:25:44', 1);
