INSERT INTO `#__cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'one_column', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-head-alt">\r\n<h3>Whoops, our bad...</h3>\r\n</div>\r\n<dl><dt>The page you requested was not found, and we have a fine guess why.</dt><dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul>\r\n</dd></dl>\r\n<p>&nbsp;</p>\r\n<dl><dt>What can you do?</dt><dd>Have no fear, help is near! There are many ways you can get back on track with Magento Demo Store.</dd><dd>\r\n<ul class="disc">\r\n<li><a onclick="history.go(-1);" href="#">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a><br /><a href="{{store url="customer/account"}}">My Account</a></li>\r\n</ul>\r\n</dd></dl>\r\n<p>&nbsp;</p>\r\n<p><img style="margin-right: 15px;" src="{{skin url=''images/media/404_callout1.jpg''}}" alt="" /><img src="{{skin url=''images/media/404_callout2.jpg''}}" alt="" /></p>', '2007-06-20 11:38:32', '2012-10-17 01:44:53', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'two_columns_right', NULL, NULL, 'home', NULL, ' {{block type="cms/block" block_id="block-freeshipping"}} \r\n', '2007-08-23 03:03:25', '2013-01-15 23:55:33', 1, 0, '<reference name="slideshow">        \r\n	<block type="slickslider/list" name="slickslider.list">\r\n                       <action method="setConfig">\r\n                                <values>\r\n					<module_width>940</module_width>               \r\n				</values>\r\n			</action>\r\n	</block>\r\n</reference>\r\n<reference name="topsl">\r\n       <block type="blocktabs/tabs" name="tabs1" template="smartaddons/blocktabs/tabs.phtml">\r\n                    <block type="basicproducts/home" name="tab1" template="smartaddons/basicproducts/home2.phtml"> \r\n			<action method="setConfig">\r\n 				<values>\r\n					<block_title></block_title>\r\n					<title>Featured Cakes</title>\r\n                                        <product_source>catalog</product_source>\r\n                                        <product_category>87</product_category>\r\n					<product_order_by>price</product_order_by>\r\n                                        <num_columns>10</num_columns>\r\n                                        <product_limitation>10</product_limitation>\r\n					<product_image_width>204</product_image_width>\r\n					<product_image_height>136</product_image_height>\r\n					<product_price_disp>1</product_price_disp>\r\n					<product_description_disp>1</product_description_disp>\r\n					<product_description_max_length>50</product_description_max_length>\r\n					<product_rating_summary>0</product_rating_summary>\r\n					<product_cart_or_status>1</product_cart_or_status>\r\n					<product_addtocompare>0</product_addtocompare>\r\n					<product_addtowishlist>0</product_addtowishlist>\r\n				</values>\r\n			</action>\r\n                  </block>\r\n       </block>\r\n</reference>\r\n<reference name="right">\r\n            <block type="checkout/cart_sidebar" name="cart_sidebar" template="checkout/cart/sidebar.phtml" after="catalog.leftnav">\r\n                <action method="addItemRender"><type>simple</type><block>checkout/cart_item_renderer</block><template>checkout/cart/sidebar/default.phtml</template></action>\r\n                <action method="addItemRender"><type>grouped</type><block>checkout/cart_item_renderer_grouped</block><template>checkout/cart/sidebar/default.phtml</template></action>\r\n                <action method="addItemRender"><type>configurable</type><block>checkout/cart_item_renderer_configurable</block><template>checkout/cart/sidebar/default.phtml</template></action>\r\n                <block type="core/text_list" name="cart_sidebar.extra_actions" as="extra_actions"/></block>\r\n</reference>\r\n\r\n<reference name="right">\r\n	    <block type="catalog/product_compare_sidebar" name="catalog.compare.sidebar" template="catalog/product/compare/sidebar.phtml"/>	\r\n</reference>\r\n\r\n<reference name="right">\r\n            <block type="newsletter/subscribe" name="left.newsletter" template="newsletter/subscribe.phtml"/>\r\n</reference>\r\n<remove name="breadcrumbs" />', NULL, NULL, NULL, NULL, NULL),
